function avg2suffix(avg, voteCnt) {
//  log("avg2suffix "+avg+", "+voteCnt+" - "+Math.abs(Number(voteCnt))+" - "+getThreshold());
    if (Math.abs(Number(voteCnt)) < getThreshold()) {
        return "0";
    }
    var avg2 = Math.round(avg * 2) / 2;
    var favg2 = Math.floor(avg2);
    var s = favg2;
    if (avg2 - favg2 > .25) {
        s += "_5";
    }
    return s;
}
 
